import { BrowserRouter, Link, Route, Router, Routes } from "react-router-dom";
import { Header } from "./components/Header";
import Main from "./components/main";
import { Existing } from "./pages/Extisting";

function App() {
  return (
    <div className="app">
      <Login />
    </div>
  );
}
function Login() {
  return (
    <div>
      <Header />
      <BrowserRouter>
        <Router>
          <Routes>
            <Link to={"/pages"}>Existing</Link>
            <Route path="/pages" element={<Existing />} />
          </Routes>
        </Router>
      </BrowserRouter>
    </div>
  );
}

export default App;
